import logo from './logo.svg';
import './App.css';
import MyButton from './component/MyButton'


function App() {
  return (
    <div className="App">
      <div class="content">
      <h1 class="header-text">สมัครอนุสโมสร </h1>
      <h2 class="header-text">คณะศิลปศาสตร์และวิทยาศาสตร์</h2><br></br>
      <div className="container">
        <h3 className="animated-text">สร้างผลงานเก็บเกี่ยวประสบการ</h3>
      </div>
      <MyButton/>

      </div>
    </div>
  );
}

export default App;
